  input: '"TEXT","F3XA","C00143743","In response to the Commissions November 12, 2003
    letter, the Committee amends it report as follows. Transfers from the non-federal
    account in January 2003 included significant amounts for the non-federal share
    of allocable expenditures made in 2002, but within the sixty day window permitted
    by the regulations cited the Commissions letter. Since no prohibited transfers
    occurred and no excessive transfers occurred, the declines to take any action
    of this matter. Transfers shown on Schedule H4 to the non-federal account were
    made for refunds/reimbursements received by the Committee and shown on Schedule
    A Line 15. In addition to the vendor listed (Southwest), the refunds/reimbursements
    were made by former and current employees of the Committee for COBRA health insurance
    payments by the Committee to Humana, and by the Texas Federation of Republican
    Women for sub-lease rent and postage. The payments to the vendors (900 Congress
    and Pitney Bowes) are reported within this report. Reimbursement was made either
    prior to the expenditure or within a commercially reasonable time. Items on Schedule
    B that the Commission questions were for Fundraising activities, not express advocacy
    for a federal candidate.  No staff members spent 25% or more of their time on
    activities in connection with a federal election during the month of January 2003,
    and thus the salaries were not required to be paid for with federal funds."'
